const suan=new Date();
const saat =suan.getHours();
const dakika = suan.getMinutes();  
const saatbilgi={
  "saat":saat,
  "dakika":dakika,
}

@Component({
  selector: 'app-hesap',
  templateUrl: './hesap.component.html',
  styleUrls: ['./hesap.component.css']
})
export class HesapComponent {

}
export default saatbilgi
